import { Dropdown } from 'react-bootstrap'
export default function NavbarAdmin(){
    const logout =()=>{
        const logout =()=>{
            sessionStorage.setItem('isLogin',false);
            localStorage.removeItem("token");
            history.push('/')
        }
    }
    return(
        <>
        <div id="nav-admin" style={{display:'flex',justifyContent:"space-between",marginLeft:87,height:120}}>
            <img style={{width:167,height:64,marginTop:34}} src = { require('../assets/Group 4.png').default }/> 
            
            <Dropdown style={{width:50,height:50,marginTop:44,marginRight:100,borderRadius:50}} id="dropdown-basic-button">
            <Dropdown.Toggle style={{width:50,height:50,borderRadius:50}} variant="success" id="dropdown-basic"></Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item onClick={logout} style={{color:'white'}}>Logout</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </div>
        </>
    )
}
